import { IonIcon, IonItem, IonList, IonTitle, IonToolbar } from "@ionic/react";
import { menu } from "ionicons/icons";

import menus from './assets/menu.json';


const Gasto:React.FC = () => { 

    return (<>
        <IonToolbar>
            <IonTitle>Menus </IonTitle>
        </IonToolbar>

        <IonList className='lista-menus'>
            {menus.map((m:any)=><IonItem routerLink={m.route}><IonIcon  slot="start" icon={menu} /> {m.title }</IonItem>) }
        </IonList>
    </>);
}

export default Gasto;
